import styled from '@emotion/styled';
import { Box, Paper, Stack, Typography,Button } from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme'; //**** Special import*/
import {ThemeProvider} from '@mui/material';

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:"30px",
  }));

const Login = () => {
  return (
    <ThemeProvider theme={Theme()}>
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center" sx={{
            marginTop:6,
            marginBottom:6,
        }}>
            <DemoPaper elevation={6}>
                <Stack display="flex" direction="row" justifyContent="space-between">
                    <Box flex="40%" sx={{
                        backgroundColor:theme.pelette.primary.main,
                        height:800,
                        borderTopLeftRadius:"30px",
                        borderBottomLeftRadius:"30px"
                    }}>
                    Image 
                    </Box>
                    <Box flex="55%" sx={{
                        height:800,
                        borderTopRightRadius:"30px",
                        borderBottomRightRadius:"30px",
                        display:"flex",
                        justifyContent:"flex-end"
                    }}><Button variant="contained" sx={{
                        backgroundColor:"#242a41",
                        height:"50px",
                        borderTopRightRadius:"30px",
                        fontSize:"26px"
                        }}>X</Button></Box>
                </Stack>

            </DemoPaper>
        </Stack>
    </ThemeProvider>
  )
}

export default Login
